import React, { useState } from 'react'
import { Input } from '../Components/UI/Input/Input'
import { Button } from '../Components/UI/Button/Button'
import profile from '../assets/profile.png'


export const Profile = () => {

    const [newEmail, setEmail] = useState('')
    const [newPass, setPass] = useState('')
    const [confPass, setConfPass] = useState('')

    return (
        <div className="max-w-lg ">

            <img src={profile} alt="profile" className=" rounded-full w-44 h-40 m-auto mb-10"/>

            <section className="flex mb-10">
                <Input placeholder="email" type="text" value={newEmail} onChange={(e) => setEmail(e.target.value)}/>
            </section>

            <section className="flex mb-10">
                <Input placeholder="password" type="email" value={newPass} onChange={(e) => setPass(e.target.value)}/>
            </section>

            <section className="flex mb-10">
                <Input placeholder="password" type="password" value={confPass} onChange={(e) => setConfPass(e.target.value)}/>
            </section>
        </div>
    )
}
